import "../styles/App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from './HomePage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/homePage" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
